	"Draw": [
		{
			"file": "Draw.js",
			"content": "import React, { Component } from 'react';\nimport { Panel, Draw, Toolbar, Button, Spacer, Label } from '@extjs/reactor/modern';\n\nexport default class DrawExample extends Component {\n    \n    componentDidMount() { \n        this.refs.draw.on({\n            element: 'element',\n            mousedown: this.onMouseDown,\n            mousemove: this.onMouseMove,\n            mouseup: this.onMouseUp,\n            mouseleave: this.onMouseUp\n        });\n    }\n\n    clear = () => {\n        const { draw } = this.refs;\n        draw.getSurface().destroy();\n        draw.getSurface('overlay').destroy();\n        draw.renderFrame();\n    }\n\n    onMouseDown = (e) => {\n        let { draw } = this.refs, \n            surface = draw.getSurface(),\n            xy, x, y;\n\n        if (!draw.sprite) {\n            xy = surface.getEventXY(e);\n            x = xy[0];\n            y = xy[1];\n\n            draw.list = [x, y, x, y];\n            draw.lastEventX = x;\n            draw.lastEventY = y;\n\n            draw.sprite = surface.add({\n                type: 'path',\n                path: ['M', draw.list[0], draw.list[1], 'L', draw.list[0] + 1e-1, draw.list[1] + 1e-1],\n                lineWidth: 30 * Math.random() + 10,\n                lineCap: 'round',\n                lineJoin: 'round',\n                strokeStyle: new Ext.util.Color(Math.random() * 127 + 128, Math.random() * 127 + 128, Math.random() * 127 + 128)\n            });\n\n            surface.renderFrame();\n        }\n    }\n\n    onMouseMove = (e) => {\n        let { draw } = this.refs,\n            surface = draw.getSurface(),\n            path, xy, x, y, dx, dy, D;\n\n        if (draw.sprite) {\n            xy = surface.getEventXY(e);\n            x = xy[0];\n            y = xy[1];\n            dx = draw.lastEventX - x;\n            dy = draw.lastEventY - y;\n            D = 10;\n\n            if (dx * dx + dy * dy < D * D) {\n                draw.list.length -= 2;\n                draw.list.push(x, y);\n            } else {\n                draw.list.length -= 2;\n                draw.list.push(draw.lastEventX = x, draw.lastEventY = y);\n                draw.list.push(draw.lastEventX + 1, draw.lastEventY + 1);\n            }\n\n            path = smoothList(draw.list);\n\n            draw.sprite.setAttributes({\n                path: path\n            });\n\n            if (Ext.os.is.Android) {\n                Ext.draw.Animator.schedule(() => surface.renderFrame(), draw);\n            } else {\n                surface.renderFrame();\n            }\n        }\n    }\n\n    onMouseUp = (e) => {\n        this.refs.draw.sprite = null;\n    }\n\n    onResize = () => {\n        const { draw } = this.refs;\n        const size = draw.element.getSize();\n        draw.getSurface().setRect([0, 0, size.width, size.height]);\n        draw.renderFrame();\n    }\n\n    render() {\n        return (\n            <Panel shadow layout=\"fit\">\n                <Toolbar docked=\"top\">\n                    <div>Use your {Ext.supports.Touch ? 'finger' : 'mouse'} to paint on the surface below.</div>\n                    <Spacer/>\n                    <Button handler={this.clear} text=\"Clear\"/>\n                </Toolbar>\n                <Draw ref=\"draw\"/>  \n            </Panel>\n        )\n    }\n}\n\nfunction smoothList(points) {\n    if (points.length < 3) {\n        return ['M', points[0], points[1]];\n    }\n\n    var dx = [], dy = [], result = ['M'],\n        i, ln = points.length;\n\n    for (i = 0; i < ln; i += 2) {\n        dx.push(points[i]);\n        dy.push(points[i + 1]);\n    }\n\n    dx = Ext.draw.Draw.spline(dx);\n    dy = Ext.draw.Draw.spline(dy);\n    result.push(dx[0], dy[0], 'C');\n\n    for (i = 1, ln = dx.length; i < ln; i++) {\n        result.push(dx[i], dy[i]);\n    }\n\n    return result;\n}"
		}
	],
	"EdgeMenu": [
		{
			"file": "EdgeMenu.js",
			"content": "import React, { Component } from 'react';\nimport { ViewPort, Panel, Button, Menu as EdgeMenu } from '@extjs/reactor/modern';\n\nexport default class MenuExample extends Component {\n\n    constructor() {\n        super();\n        this.menus = [];\n        \n        this.state = {\n            left: false,\n            right: false,\n            top: false,\n            bottom: false\n        };\n    }\n\n    componentDidUpdate() {\n        if (this.state.left) {\n            Ext.Viewport.showMenu('left');\n        } else {\n            Ext.Viewport.hideMenu('left');\n        }\n    }\n\n    render() {\n        const { left, right, top, bottom } = this.state;\n        \n        return (\n            <Panel>\n                <EdgeMenu side=\"left\" ref=\"left\" reveal hidden={!this.state.left} onHide={() => this.setState({ left: false })}>\n                    <Button text=\"Settings\" iconCls=\"x-fa fa-gear\" handler={() => this.setState({left: false})}/>\n                    <Button text=\"New Item\" iconCls=\"x-fa fa-pencil\" handler={() => this.setState({left: false})}/>\n                    <Button text=\"Star\" iconCls=\"x-fa fa-star\" handler={() => this.setState({left: false})}/>\n                </EdgeMenu>\n                <EdgeMenu side=\"right\" ref=\"right\" reveal hidden={!this.state.right} onHide={() => this.setState({ right: false })}>\n                    <Button text=\"Settings\" iconCls=\"x-fa fa-gear\" handler={() => this.setState({right: false})}/>\n                    <Button text=\"New Item\" iconCls=\"x-fa fa-pencil\" handler={() => this.setState({right: false})}/>\n                    <Button text=\"Star\" iconCls=\"x-fa fa-star\" handler={() => this.setState({right: false})}/>\n                </EdgeMenu>\n                <EdgeMenu side=\"top\" ref=\"top\" cover hidden={!this.state.top} onHide={() => this.setState({ top: false })}>\n                    <Button text=\"Settings\" iconCls=\"x-fa fa-gear\" handler={() => this.setState({top: false})}/>\n                    <Button text=\"New Item\" iconCls=\"x-fa fa-pencil\" handler={() => this.setState({top: false})}/>\n                    <Button text=\"Star\" iconCls=\"x-fa fa-star\" handler={() => this.setState({top: false})}/>\n                </EdgeMenu>\n                <EdgeMenu side=\"bottom\" ref=\"bottom\" slide hidden={!this.state.bottom} onHide={() => this.setState({ bottom: false })}>\n                    <Button text=\"Settings\" iconCls=\"x-fa fa-gear\" handler={() => this.setState({bottom: false})}/>\n                    <Button text=\"New Item\" iconCls=\"x-fa fa-pencil\" handler={() => this.setState({bottom: false})}/>\n                    <Button text=\"Star\" iconCls=\"x-fa fa-star\" handler={() => this.setState({bottom: false})}/>\n                </EdgeMenu>\n                <div><b>Ext.Menu</b> is a component which allows you to easily display slidingmenus from any side of the screen.</div>\n                <br/>\n                <br/>\n                <div>You can show the menus by either tapping the buttons below,or by swiping from the edge of the screen.</div>\n                <Button handler={() => this.setState({ left: true })} text=\"Toggle left menu (reveal)\"/>\n                <Button handler={() => this.setState({ right: true })} text=\"Toggle right menu (reveal)\"/>\n                <Button handler={() => this.setState({ top: true })} text=\"Toggle top menu (cover)\"/>\n                <Button handler={() => this.setState({ bottom: true })} text=\"Toggle bottom menu (slide)\"/>\n            </Panel>\n        )\n    }\n}\n"
		}
	],
